private void updateDesign(InventDimFormDesignUpdate _mode)
{
    Set validInventDimDSset;
    InventDimControlIdCollection inventDimControlIdCollection;
    boolean emptyLine;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = RORRshInventDimCtrl_Frm_Editable::newFromFormItem(element, RentalShopTrans.ItemId);
            }
            // Fall through

        case InventDimFormDesignUpdate::Active,
             InventDimFormDesignUpdate::FieldChange:
            emptyLine = RentalShopTrans.ItemId == '';
            inventoryDimensionsGrid.allowEdit(!emptyLine);
            inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(RentalShopTrans.ItemId));
            inventDimFormSetup.formSetControls(_mode == InventDimFormDesignUpdate::Active);                
            break;

        default :
            throw error(strFmt("@SYS54195",funcName()));
    }
}

public int active()
{
    int ret;

    ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);
    cockpitFormHelper.rentalShopTransDSActive();

    return ret;
}

public void lookup(FormControl _formControl, str _filterStr)
{
    if (!EcoResProductMasterConfigurationMgr::configure(_formControl,
                                                        RentalShopTrans.ItemId,
                                                        InventDim::findOrCreate(inventDim).InventDimId))
    {
        super(_formControl, _filterStr);
    }
}

