public void clicked()
{      
    Args args = new Args();

    args.caller(element);

    if (RentalShopTrans.TradeType == RORTradeType::SalesPurch)
    {
        this.menuItemName(menuItemDisplayStr(SalesLine));
        args.record(RentalShopTrans);
    }
    else
    {
        args.record(RorRshShopTransReference::findSalesLine(RentalShopTrans.TransId));
    }

    this.menufunction().run(args);
}

